message:
cloudbuild: Push additional images from cloudbuild

This allows them to be promoted to k8s.gcr.io (when we nominate them
for promotion)

Makefile remove nodeup-gocode

Makefile nodeup-dist clean up permissions in container

Makefile install and all depend on ${NODEUP}

Create golden image test for nodeup kube-apiserver

The building of the manifests for nodeup tasks can be a little opaque;
create a test to verify and expose what is happening.

Removed misleading comment about metav1

@rdrgmnzs pointed out that the comment needed to be updated after
Removing!

Update apiVersion to resolve 'no matches for kind "Deployment" in version "extensions/v1beta"' message.

